import logo from './logo.svg';
import './App.css';

class App extends React.Component{
    constructor(props){
        super(props)
}

render() {
    return (
        <div className="App">
            <div className="main-background">
                <h1 className="headline">One Big Thing</h1>
                <div className="btn-oben">
                    <div className="plus">+</div>
                </div>
                <div className="little-things-wrapper">
                    <div className="btn">
